import React, { useState } from 'react';

function NewProductForm({ traceId, onSave, onCancel }) {
  const [name, setName] = useState('');
  const [origin, setOrigin] = useState('');
  const [status, setStatus] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave({
      id: traceId,
      name,
      origin,
      status,
      history: [`Created: ${new Date().toISOString().split('T')[0]}`]
    });
  };

  return (
    <div>
      <h2>New Product Entry</h2>
      <form onSubmit={handleSubmit}>
        <p><strong>Trace ID:</strong> {traceId}</p>
        <label>
          Name:
          <input value={name} onChange={e => setName(e.target.value)} required />
        </label>
        <br />
        <label>
          Origin:
          <input value={origin} onChange={e => setOrigin(e.target.value)} required />
        </label>
        <br />
        <label>
          Status:
          <input value={status} onChange={e => setStatus(e.target.value)} required />
        </label>
        <br />
        <button type="submit">Save Product</button>
        <button type="button" onClick={onCancel} style={{ marginLeft: 8 }}>Cancel</button>
      </form>
    </div>
  );
}

export default NewProductForm;
